  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Sarah and HUTTON, Thomas Biddulph
  JHUTTON, Marianne Elizabeth Georgina (Bessie) and KEMP, Francis James
  IKEMP, Alfred Ernest and MAY, Dory
  JKEMP, Gertrude and COLLETT, Earle Glennie
  ICOLLETT, Roy Earle and SILICH, Lynette
  02> COLLETT, Roy Earlem on 25.12.1993 to (2)SILICH, Lynette
  b 16.10.1951
  b 07.07.1955
  Lynette nee Fuller. She has three daughters, Tania (b. 14.05.1978), Julie (b. 30.10.1979) and
  Melanie (b. 31.07.1981). Address: Waipapa Road, RD 2, Kerikeri, Bay of Islands.
  02> KEMP, Hayward Francis m on 18.07.1927 to ALLISON, Ruby Mary
  b 22.08.1889 d 11.07.1988
  b 28.07.1890 d ** ** ****
  Hayward b. at Matahiia. No children.
  03> KEMP, Edith Sarah m on 27.04.1915 to WILSON, James Frederic (Fritz)
  b 02.03.1891 d 18.11.1974
  b 05.04.1888 d 18.01.1957
  Edith b. at Auckland and educated at home and at school in Takapuna. She was m. at Kaharau Church, Ruatoria
  and bd. at Waverley Cemetery. Fritz, twin s/o Frederick William Wilson and Mary Allison, b. and d at
  Wanganui and bd, at Waverley Cemetery. (Frederick was born in England and went to Calcutta, India as a
  clerk before coming to New Zealand in the 1880's. He purchased "Raithby" where he farmed until he retired
  to Wanganui. Mary Allison was born in Wanganui, the d/o of Dr James Allison and Georgina Gillfillan.)
  Fritz was educated at Wanganui Collegiate (1902-07). After leaving school he went to the East Coast to work
  for TS Williams at "Kaharau", Ruatoria. He then took a leasehold block, "Takanga" near Lottin Point, where
  he farmed until returning to "Raithby" in 1939, remaining there until his death.
  Edith and Fritz were both actively involved in St Stephen's Anglican Church in Waverley. Fritz was a keen
  shooter and fisherman and Edith painted in her youth.
  01> WILSON, Mary Elizabeth (Betsy) m on 18.12.1941 to NEWLAND, David Leon
  b 10.02.1916 d 17.12.1995
  b 16.05.1912 d 30.11.1987
  Elizabeth b. at Auckland and m, at St Stephen's Church, Waverley. David, s/o John (Jack) George
  Newland and Maud Mary Elizabeth Gwynne, d. at Wanganui and bd, at Waverley Cemetery. (Jack's
  grandparents landed at New Plymouth from the 'Amelia Thompson' in 1841. Maud had come from Wales via
  Australia.)
  Betsy lived at "Takanga", Lottin Point where she was educated by a governess. She trained as a
  Karitane nurse in Auckland (1938-39) and practised in Taranaki when her parents returned to Waverley.
  David was educated at Kohi and Waverley Primary Schools and Feilding Agricultural High School. He
  spent some time in the New Zealand Territorial Army rising to the rank of Sergeant. He took over the
  lease of "Putahi" at the beginning of WW2, This was next to "Bankhead", his parent's farm, and the two
  were worked together. He handed over to his sons, Alan and Bruce in 1974 and retired to Waverley.
  David represented Wanganui at Rugby and won the Taranaki doubles tennis title in the 1930's. He was a
  life member of the Waverley Golf Club. Betsy was active in St Stephen's Anglican Church and enjoyed
  painting.
  01> NEWLAND, Heather Angela m on 27.02.1971 to HAMMOND, Matthew Lynn
  b 25.07.1942
  b 26.11.1940
  Angela b. at Wanganui and m. at St Stephen's Church, Waverley. Matthew, s/o Lynn Phillips Hammond
  and Mary Murray Blyth, b. at Wanganui. Address: "Piripiri" Station, Awakino, RD 1, Mokau.
  Angela was educated at Waverley Primary and St Mary's School, Stratford (1956-59). She worked in
  the Wanganui Public Library (1961) and in the School Library Service in Wanganui and New Plymouth.
  She then travelled overseas for two years before her marriage.
  Matthew attended Wanganui East Primary School and Wanganui Collegiate (1954-57). He worked as an
  agricultural contractor in the Wanganui area and purchased a farm at Wanganui East. They purchased
  "Piripiri" Station in 1974. Matthew is a councillor for the Tainui Riding of the Waitomo District
  Council (1981-90) and chairman of the Meat and Wool Section of the Federated Farmers Taranaki
  Province (1991). Angela and Matthew are both keen tennis and golf players and Matthew enjoys duck
  shooting.
